  justify-content: space-between;
  align-items: center;
  margin: 10px 30px;
`;

const LinkContainer = inhert;

const NavLink = styled(Link)`
  color: var(--white);
  text-decoration: none;
`;
function Nav() {
  return (
    <Container>
      <h1>Baseball Data</h1>
      <div>
        <NavLink>How It Works</NavLink>
        <NavLink>About</NavLink>
      </div>
    </Container>
  );
}

export default Nav;
